column1:
Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. How high is the balloon above the field (that is, the length of $OH$)? [asy]
size(200);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

In the diagram, the smaller circles touch the larger circle and touch each other at the center of the larger circle. The radius of the larger circle is $6.$ What is the area of the shaded region?

[asy]
size(100);
import graph;
filldraw(Circle((0,0),2),mediumgray);
filldraw(Circle((-1,0),1),white);
filldraw(Circle((1,0),1),white);
[/asy]

Cylinder $B$'s height is equal to the radius of cylinder $A$ and cylinder $B$'s radius is equal to the height $h$ of cylinder $A$. If the volume of cylinder $A$ is twice the volume of cylinder $B$, the volume of cylinder $A$ can be written as $N \pi h^3$ cubic units. What is the value of $N$?

[asy]
size(4cm,4cm);
path a=(0,-1.2)..(-10,0)--(10,0)..cycle;
path b=(17,-0.9)..(13,0)--(21,0)..cycle;
path c=(0,1.2)..(-10,0)--(10,0)..cycle;
path d=(17,0.9)..(13,0)--(21,0)..cycle;
draw(c);
draw(d);
draw(shift((0,7))*a);
draw(shift((0,7))*c);
draw(shift((0,15))*b);
draw(shift((0,15))*d);
draw((-10,0)--(-10,7));
draw((10,0)--(10,7));
draw((13,0)--(13,15));
draw((21,0)--(21,15));
draw(a);
draw(b);
label("$A$",(0,9),N);
label("$B$",(17,18),N);
[/asy]

In quadrilateral $ABCD$, sides $\overline{AB}$ and $\overline{BC}$ both have length 10, sides $\overline{CD}$ and $\overline{DA}$ both have length 17, and the measure of angle $ADC$ is $60^\circ$. What is the length of diagonal $\overline{AC}$? [asy]
draw((0,0)--(17,0));
draw(rotate(301, (17,0))*(0,0)--(17,0));
picture p;
draw(p, (0,0)--(0,10));
draw(p, rotate(115, (0,10))*(0,0)--(0,10));
add(rotate(3)*p);

draw((0,0)--(8.25,14.5), linetype("8 8"));

label("$A$", (8.25, 14.5), N);
label("$B$", (-0.25, 10), W);
label("$C$", (0,0), SW);
label("$D$", (17, 0), E);
[/asy]

What is the probability of spinning the spinner pictured and getting a prime number? Express your answer as a common fraction. [asy]
import olympiad; defaultpen(linewidth(0.8)); size(100); dotfactor=4;
draw(Circle((0,0),1));
string[] labels = {"3","6","1","4","5","2"};
for(int i = 0; i < 6; ++i){

label(labels[i],0.7*dir(60*i));

draw((0,0)--dir(60*i - 30));
}
draw((0,0)--0.7*dir(130),linewidth(2.0),EndArrow(size=6));
[/asy]

If $\overline{AD} \| \overline{FG}$, how many degrees are in angle $EFG$?

[asy]
import olympiad;

pair A = (-15,20);
pair B = (-12,35);
pair C = (35,50);
pair D = (35,20);
pair E = (14,20);
pair F = (0,0);
pair G = (40,0);

draw(F--G);
draw(F--C);
draw(A--D);
draw(B--E);

label("F", F, W);
label("G", G, ENE);
label("C", C, N);
label("A", A, W);
label("D", D, ENE);
label("E", E, SE);
label("B", B, NW);

draw(scale(20)*anglemark(G, F, C));
draw(shift(E)*scale(35)*shift(-E)*anglemark(B, E, A));
draw(shift(E)*scale(20)*shift(-E)*anglemark(C, E, B));

label("$x$", (6,20), NW);
label("$2x$", (13,25), N);
label("$1.5x$", (5,0), NE);
[/asy]

The following line is parameterized, so that its direction vector is of the form $\begin{pmatrix} a \\ -1 \end{pmatrix}.$  Find $a.$

[asy]
unitsize(0.4 cm);

pair A, B, L, R;
int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

A = (-2,5);
B = (1,0);
L = extension(A, B, (0,8), (1,8));
R = extension(A, B, (0,-8), (1,-8));

draw(L--R, red);

label("$x$", (8,0), E);
label("$y$", (0,8), N);
[/asy]

In triangle $ABC,$ $E$ lies on $\overline{AC}$ such that $AE:EC = 2:1,$ and $F$ lies on $\overline{AB}$ such that $AF:FB = 1:4.$  Let $P$ be the intersection of $\overline{BE}$ and $\overline{CF}.$

[asy]
unitsize(0.8 cm);

pair A, B, C, D, E, F, P;

A = (1,4);
B = (0,0);
C = (6,0);
E = interp(A,C,2/3);
F = interp(A,B,1/5);
P = extension(B,E,C,F);

draw(A--B--C--cycle);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$E$", E, NE);
label("$F$", F, W);
label("$P$", P, S);
[/asy]

Then
\[\overrightarrow{P} = x \overrightarrow{A} + y \overrightarrow{B} + z \overrightarrow{C},\]where $x,$ $y,$ and $z$ are constants such that $x + y + z = 1.$  Enter the ordered triple $(x,y,z).$

What is the matrix $\mathbf{M}$ that performs the transformation which sends square $ABCD$ to square $A'B'C'D'$?  (In particular, $A$ goes to $A',$ and so on.)

[asy]

size(200);
import graph;

pair Z=(0,0), A=(2,3), B=(-3,2), C=(-4,1), D=(-1,-4);

Label f; 
f.p=fontsize(6); 
xaxis(-1.5,1.5,Ticks(f, 1.0)); 
yaxis(-0.5,2.5,Ticks(f, 1.0));

draw((0,0)--(1,0)--(1,1)--(0,1)--(0,0),red);
dot((0,0)); label("$A=A'$", (0,0), SE);
dot((1,0)); label("$D$", (1,0), NE);
dot((1,1)); label("$C=D'$", (1,1), E);
dot((0,1)); label("$B$", (0,1), NE);

draw((0,0)--(1,1)--(0,2)--(-1,1)--(0,0), blue);
dot((0,2)); label("$C'$", (0,2), NE);
dot((-1,1)); label("$B'$", (-1,1), W);

[/asy]

A circle centered at $O$ has radius 1 and contains the point $A$. Segment $AB$ is tangent to the circle at $A$ and $\angle
AOB=\theta$. If point $C$ lies on $\overline{OA}$ and $\overline{BC}$ bisects $\angle ABO$, then express $OC$ in terms of $s$ and $c,$ where $s = \sin \theta$ and $c = \cos \theta.$

[asy]
pair A,B,C,O;
O=(0,0);
A=(1,0);
C=(0.6,0);
B=(1,2);
label("$\theta$",(0.1,0),NE);
label("$O$",O,S);
label("$C$",C,S);
label("$A$",A,E);
label("$B$",B,E);
draw(A--O--B--cycle,linewidth(0.7));
draw(C--B,linewidth(0.7));
draw(Circle(O,1),linewidth(0.7));
[/asy]

Line segment $\overline{AB}$ is extended past $B$ to $P$ such that $AP:PB = 10:3.$  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants $t$ and $u.$  Enter the ordered pair $(t,u).$

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,10/7);

draw(A--P);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, S);
[/asy]
